const SearchNew = () => {
  return (
    <div>
    <h3>SearchNew</h3>
    <div class="row">
    <form class="col s12">
      <div class="row">
        <div class="input-field col s6">
          <input placeholder="Placeholder" id="first_name" type="text" class="validate" />
          <label for="first_name">First Name</label>
          </div>
          </div>
          </form>
        </div>
        </div>
  );
};

export default SearchNew;
